import React from 'react';
import './Style.css';

function Navbar() {
  return (
    <nav id="AppNav" class="navbar">
      <div className='navbar-center'>
      <ul>
        <il>
          <a><button id="Home_btn" type="button" class="btn btn-light m-4">Characters</button></a>
          <a><button id="WatchList_btn" type="button" class="btn btn-light m-4"><a href='#'></a>Watch List</button></a>
          <a><button id="About_btn" type="button" class="btn btn-light m-4"><a href='#'></a>About</button></a>
        </il>
      </ul>
      </div>
    </nav>
  );
}

export default Navbar;
